import ReactDOM from "react-dom";
import Avatar from "./Avatar";

import Testimonialone from "./Testimonialone";
import Testimonialtwo from "./Testimonialtwo";

function App() {
 
  return (
    <main>
      <div className="slider">
      <Avatar />
        <Testimonialone />
        <Testimonialtwo  />
       
      </div>
      

      
    </main>
  );
}

export default App;
